import { OrderlistWrapper } from "../Styles/Orderlist-Style";


function Orderlist() {
    return(
        <>
            <OrderlistWrapper>
                <div className="wrapper_inner">
                    <div className="page_head">
                        <h2>My Orders</h2>
                    </div>
                    <div className="order_section">
                        <div className="left_sec"></div>
                    </div>
                </div>
            </OrderlistWrapper>
        </>
    );
}

export default Orderlist;
